        {products.map(product =>(
          <article className="menu-item">
 <img src={product.img} className="photo" />
        <div className="item-info">
          <header>
            <h4>{product.title}</h4>
            <h4 className="price">{product}</h4>
          </header>
          <p className="item-text">{product}</p>
        </div>
</article>
        ))}


    </div>
  );
};

export default Menu;
